import React from 'react'
import './Styles/Shop.css';
import Items from './Items';



 function Shop (props) {
      const {products} = props;
  return (    
        <div className='Card-Shop-Container'>
        {products.map((product) =>(
            <Items key={product.id} props={product}/>
  
        ))}  
        </div>
  )
}


export default Shop;
